import React from 'react';
import data from "../Cards/CardData.json"

export function Card() {
    return (
        <div>
            {data.map((val) => (
                <div key={val.id}>
                    {/* {val.img} */}
                    <a href={val.img}></a>
                    {val.name}
                    {val.category}
                </div>
            ))}
        </div>
    )
}

